import React from "react";
import Carousel from "react-elastic-carousel";
import { Paper, Button, Box } from "@mui/material";

const Crousell = () => {
  var items = [
    {
      name: "Random Name #1",
      description: "description here 1",
    },
    {
      name: "Random Name #2",
      description: "description here 2",
    },
  ];

  return (
    <Carousel>
      {items.map((item, i) => (
        <Box key={i} item={item} />
      ))}
    </Carousel>
  );
};

export default Crousell;
